import React, { useEffect, useState } from "react";
import { Api } from "./api";
import ViewUser from "./view-user";

function App() {
  const [user, setUser] = useState([]);
  const FetchUserData = async () => {
    const data = await Api('https://api.escuelajs.co/api/v1/users')
    if(data){
      console.log({data});
      setUser(data)
    }
  }
  useEffect(() => {
    FetchUserData()
  }, [])
  return (
    <div className="App">
        <div className="table">
          <table>
            <thead>
              <tr>
                <td>Id</td>
                <td>Name</td>
                <td>Email</td>
                <td>Role</td>
                <td>Avatar</td>
                <td>Actions</td>
              </tr>
            </thead>
            <tbody>
            {user.map(item => (
              <tr key={item.id}Â >
                <td>{item.id}</td>
                <td>{item.name}</td>
                <td>{item.email}</td>
                <td>{item.role}</td>
                <td><img src={item.avatar} alt="" /></td>
                <td>
                  <i><img src={ViewUser} alt="View User" /></i>
                </td>
              </tr>
            ))}
            </tbody>
          </table>
        </div>
    </div>
  );
}

export default App;
